    {
      "offset_seconds": 138,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hi, how are you?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 150,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, let me know if you're able to hear me. Um, you could just type in the chat or unmute yourself.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 171,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Wait, what did you say? My fault.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 174,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, are you able to hear me? I guess you are now.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 178,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, could you share your screen so I can see what you're working on today?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 181,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Yeah. I'm almost done. I just gotta finish this, but this is low-key confusing.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 184,
      "event_type": "view_change",
      "description": "Screen sharing starts again on Moby Max",
      "details": "Problem 9: Baseball field Pythagorean theorem application"
    },
    {
      "offset_seconds": 189,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh, this is easy.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 191,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Huh?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 192,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "No, it's confusing.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 194,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh, it's confusing. Oh, okay.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 196,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, yeah, we can work through this problem together. Um...",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 204,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay. A baseball field... there is 60 feet between the pitcher and third base.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 209,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "90 feet between the catcher and third base.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 211,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Okay, so..."
    },
    {
      "offset_seconds": 220,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 222,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "How far is the distance between the pitcher and the catcher?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 225,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh, okay. Yeah, so this is the, um, Pythagorean theorem.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 230,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Have you all discussed it in class?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 232,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Yeah.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 233,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay. So they want you to find b. Um, so then you know that a squared plus b squared equals c squared.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 247,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Mhm.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 248,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Is it that same one for this one? Or is it a squared plus c squared?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 255,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, so you would have to do like 90 squared plus 60 squared and then take the square root of that.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 266,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um, yeah, I don't have a calculator right now, but...",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 272,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "I don't know what the actual number is.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 276,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "It says 107.7. I don't see that anywhere.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 279,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Oh no, and then 32, you gotta... oh yeah, okay.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 286,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Just find an estimate and then round to the nearest tenth. So it's four...",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 296,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So you'd be doing 90 squared plus 60 squared.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 307,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "And then take the square root of that.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 314,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um...",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 315,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Yeah, I don't calculate what the actual number is.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 322,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Wait, what?",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 327,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Wait, so is a equal...?",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 330,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Yeah, I'm also confused why it's not one of the choices.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 343,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Because it makes sense to do like 60 squared plus 90 squared but I don't know why that's not one of the choices.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 354,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Radio button for option 4 (sqrt 5,400)",
      "details": "Student selects an incorrect answer"
    },
    {
      "offset_seconds": 356,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next arrow button"
    },
    {
      "offset_seconds": 357,
      "event_type": "view_change",
      "description": "Correct answer feedback appears",
      "details": "Shows answer key and calculation sqrt(3600) = 60"
    },
    {
      "offset_seconds": 358,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 360,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 361,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next arrow button"
    },
    {
      "offset_seconds": 362,
      "event_type": "view_change",
      "description": "Problem 10 loads",
      "details": "Roof diagonal problem"
    },
    {
      "offset_seconds": 364,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Dwight needs to know the diagonal of the roof to begin repairs. He knows that the height of the house is 20 feet, half of the length of the front of the house is 15 feet, and the width of the roof is 60 feet. Use these measurements to find the diagonal of the roof.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 381,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Radio button for option 1 (sqrt 4,225 = 65 ft)"
    },
    {
      "offset_seconds": 395,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next arrow button"
    },
    {
      "offset_seconds": 398,
      "event_type": "view_change",
      "description": "Problem 11 loads",
      "details": "Let's try to improve your score page"
    },
    {
      "offset_seconds": 402,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next arrow button"
    },
    {
      "offset_seconds": 403,
      "event_type": "view_change",
      "description": "Problem 12 loads",
      "details": "Box diagonal problem (Rectangular Prism)"
    },
    {
      "offset_seconds": 405,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Radio button for sqrt(17)"
    },
    {
      "offset_seconds": 406,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next arrow button"
    },
    {
      "offset_seconds": 409,
      "event_type": "view_change",
      "description": "Problem 13 loads",
      "details": "Table leg problem"
    },
    {
      "offset_seconds": 429,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay, tell me, tell me how.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 449,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay, I'm lost now.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 456,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Wait no, that was 9 and 12. Wait no.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 459,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "I don't know. I forgot. I don't, I don't recommend these numbers.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 465,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay. Yeah, this is also confusing.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 468,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Um... the way they describe it is so weird but...",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 485,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "So 10 and 10 is 100, then 8 times 8 is 64. That equals 36. Wait no, I gotta subtract.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 492,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh yeah, wait, I did subtract. 36. Yeah I don't get this one.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 497,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 501,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "I'm also not sure for this one as well. Um, the way they describe it is so weird.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 515,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Because she came in and she asked me if I was good and I was like yeah I mean I did my goal. I did my two lessons.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 526,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 530,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Is this your last one for today?",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 532,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "I guess so.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 533,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay. Maybe you could just guess.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 543,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "I think it's probably one of these two but I don't really know which one.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 546,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay, tell me, tell me how.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 548,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "I don't know, it just seems logical.",
      "speaker_name": "Jesse"
    },
    {
      "offset_seconds": 552,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Try the top one.",
      "speaker_name": "Marena Keys"
    },
    {
      "offset_seconds": 553,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Radio button for top option (sqrt 209)"
    },
    {
      "offset_seconds": 555,
